import React from "react";
import "./Header.css";

const Header = props => (

    <div className="header">
        <div className="title">Looney Tunes Memory Game!</div>
        <div className="title">{props.children}</div>
        <div className="score">
            Score: {props.score}
        </div>
        <br></br>
        <div className="highScore">
            High Score: {props.highscore}
        </div>
    </div>
);

export default Header;
